const workPieces=[{id:1,title:"#offTopic Geek Culture Store",description:"This is a online store where users can sell and buy geek culture merch.",githubLink:"https://github.com/CyborgSemon/summative-3-front",image:"assets/geekculturestore.png"},{id:2,title:"Pokemon Type Filter",description:"This is a web app the filters the original 151 pokemon by Type",githubLink:"https://github.com/BraydenGray416/Pokemon-Filtering",image:"assets/pokemonFilter.png"},{id:3,title:"Grind Digital Ordering System",description:"This is a digital ordering system for the milkshake bar Grind. Grind is located in Upper Hutt and provides various unique flavors",githubLink:"https://github.com/CyborgSemon/summative-3-front",image:"assets/grind.png"}];function showProjects(){let e="";for(var i=0;i<workPieces.length;i++){const t=workPieces[i];e+=`<div class="card col-12 ml-2 h-100" style="width: 30rem;">\n    <img src="${t.image}" class="card-img-top" alt="${t.title}">\n    <div class="card-body">\n    <h5 class="card-title">${t.title}</h5>\n    <p class="card-text">${t.description}</p>\n    <a href="#" class="btn btn-danger workCards" data-id="$projects.id}">Read More</a>\n    <a href="${t.githubLink}" class="btn btn-dark" >Github</a>\n    </div>\n    </div>`,console.log(e)}document.getElementById("projectSection").innerHTML=e}showProjects();